import React from "react";
import { Link } from "react-router-dom";
import OrderList from "../OrderList/OrderList";// Assuming you have an OrderList component
import ProductList from "../ProductList/ProductList";// Assuming you have a ProductList component

import "./home.css"; // Add your styles as needed

const home = () => {
  return (
    <div className="sellerHomePage">
      <header>
        <h1>Seller Dashboard</h1>
        <Link to="/add-product">Add Product</Link>
      </header>
      <section>
        <div className="orderSection">
          <h2>Recent Orders</h2>
          <OrderList />
        </div>
        <div className="productSection">
          <h2>Product List</h2>
          <ProductList />
        </div>
      </section>
    </div>
  );
};

export default home;
